import React, { Component } from 'react'
import {url} from '../../config'
export default class SubjectList extends Component {
    componentDidMount(){
        const {data} = this.props.location.state;
        fetch(url + 'subject/:classId/:instructorId')
        .then(res=>{
            return res.json();
        })
    }
    render() {
        return (
            <div>
                <h1>SubjectList</h1>
            </div>
        )
    }
}
